,"0A9F":["雌火竜の麗殻",5,40000,99,1031,"1F7D","鋼殻よりもさらに頑丈な外殻。この地域では敬意を込めて【れいかく】と呼んでいる。"]
,"0AA0":["雌火竜の艶殻",5,50000,99,1100,"1F7E","滅多に出会えない極上の外殻。強度に加え、見事なほどの美しい艶で覆われている。"]
,"0AA1":["凄くねじれた角",5,30000,99,1015,"1F7F","ディアブロスのひどくねじれた角。この素材で作られた武具は一生ものになるという。"]
,"0AA2":["凶悪なねじれた角",5,40000,99,1031,"1F80","ディアブロスのいびつにねじれた角。加工には大変な苦労を要するが、耐久力は抜群。"]
,"0AA3":["極上のねじれた角",5,50000,99,1100,"1F81","ディアブロスの美しくねじれた角。加工せず、調度品として部屋に飾るハンターも多い。"]
,"0AA4":["雪獅子の砕牙",5,30000,99,1008,"1F82","ドドブランゴの上質な牙。硬度が高く状態が良いので、より強い武具に加工できる。"]
,"0AA5":["雪獅子の穿牙",5,40000,99,1031,"1F83","ドドブランゴの極上の牙。ここまで状態の良いものにはなかなかお目にかかれない。"]
,"0AA6":["雪獅子の妖牙",5,50000,99,1100,"1F84","無数の傷跡が残るドドブランゴの鋭利な牙。雪獅子の名にふさわしい歴史を感じ取れる。"]
